import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom'
import axios from 'axios';

export class TestSessionInfo extends Component {

    state = {
        testSession: {
            id: this.props.match.params.testSessionId
        }
      }

      componentDidMount(){
        axios.get('http://web-api.testunited.org/testsessions/'+this.props.match.params.testSessionId)
         .then(res => this.setState({testSession: res.data}))
      }


    render() {
        const {id, name, result} = this.state.testSession;
        return (
            <div>
                Name: {name} <br/>
                Result: {result} <br/>
            </div>
        )
    }
}


export default TestSessionInfo
